class EventListComponent {
    constructor(EventService) {
        this.EventService = EventService;
        this.showPage = false;
        this.noPage = 1;
        this.maxResult = 5;
        this.direction = "asc";
        this.orderBy = "idEvent";
        this.beforeNoPage = 1;
    }
    ngOnInit() {
        this.searchText = null;
        this.getAllEventsWithPagination();
        this.getCountAllEvent();
    }
    counter() {
        if (this.eventTotal == 0) {
            this.totalPage = 1;
            this.showPage = false;
        }
        else {
            this.showPage = true;
            this.totalPage = Math.ceil(this.eventTotal / this.maxResult);
            console.log("Event Total :" + this.eventTotal);
            console.log("Total Page :" + this.totalPage);
        }
        if (this.noPage > this.totalPage) {
            this.noPage = this.totalPage;
        }
    }
    getAllEventsWithPagination() {
        this.EventService.getAllEventsWithPagination(this.noPage - 1, this.maxResult, this.orderBy, this.direction, this.searchText)
            .subscribe((EventList) => this.eventList = EventList);
    }
    getCountAllEvent() {
        this.EventService.getCountAllEvent(this.searchText).subscribe((eventTotal) => { this.eventTotal = eventTotal; this.counter(); });
    }
    //pagination
    apply() {
        this.noPage = 1;
        this.getAllEventsWithPagination();
        this.counter();
    }
    nextPage() {
        this.noPage++;
        if (this.noPage > this.totalPage) {
            this.noPage = this.totalPage;
        }
        this.beforeNoPage = this.noPage;
        this.getAllEventsWithPagination();
    }
    previousPage() {
        this.noPage--;
        if (this.noPage < 1) {
            this.noPage = 1;
        }
        this.beforeNoPage = this.noPage;
        this.getAllEventsWithPagination();
    }
    inputPage(event) {
        if (this.noPage < 1 && this.noPage != null) {
            this.noPage = 1;
        }
        else if (this.noPage > this.totalPage) {
            this.noPage = this.totalPage;
        }
        event.target.value = this.noPage;
        if (this.noPage != null) {
            this.beforeNoPage = this.noPage;
            this.getAllEventsWithPagination();
        }
    }
    firstPage() {
        this.noPage = 1;
        this.beforeNoPage = this.noPage;
        this.getAllEventsWithPagination();
    }
    lastPage() {
        this.noPage = this.totalPage;
        this.beforeNoPage = this.noPage;
        this.getAllEventsWithPagination();
    }
    blurInputPage(event) {
        if (this.noPage == null) {
            event.target.value = this.beforeNoPage;
            this.noPage = this.beforeNoPage;
        }
    }
    search() {
        this.noPage = 1;
        this.getAllEventsWithPagination();
        this.getCountAllEvent();
    }
}
