class RehearsalListComponent {
    constructor(RehearsalService) {
        this.RehearsalService = RehearsalService;
        this.showPage = false;
        this.noPage = 1;
        this.maxResult = 5;
        this.direction = "asc";
        this.orderBy = "idRehearsal";
        this.beforeNoPage = 1;
    }
    ngOnInit() {
        this.searchText = null;
        this.getAllRehearsalsWithPagination();
        this.getCountAllRehearsal();
    }
    disabledEdit(selesai) {
        var today = new Date();
        if (new Date(selesai) < today) {
            return true;
        }
        else {
            return false;
        }
    }
    counter() {
        if (this.rehearsalTotal == 0) {
            this.totalPage = 1;
            this.showPage = false;
        }
        else {
            this.showPage = true;
            this.totalPage = Math.ceil(this.rehearsalTotal / this.maxResult);
            console.log("Rehearsal Total :" + this.rehearsalTotal);
            console.log("Total Page :" + this.totalPage);
        }
        if (this.noPage > this.totalPage) {
            this.noPage = this.totalPage;
        }
    }
    getAllRehearsalsWithPagination() {
        this.RehearsalService.getAllRehearsalsWithPagination(this.noPage - 1, this.maxResult, this.orderBy, this.direction, this.searchText)
            .subscribe((RehearsalList) => this.rehearsalList = RehearsalList);
    }
    getCountAllRehearsal() {
        this.RehearsalService.getCountAllRehearsal(this.searchText).subscribe((rehearsalTotal) => { this.rehearsalTotal = rehearsalTotal; this.counter(); });
    }
    //pagination
    apply() {
        this.noPage = 1;
        this.getAllRehearsalsWithPagination();
        this.counter();
    }
    nextPage() {
        this.noPage++;
        if (this.noPage > this.totalPage) {
            this.noPage = this.totalPage;
        }
        this.beforeNoPage = this.noPage;
        this.getAllRehearsalsWithPagination();
    }
    previousPage() {
        this.noPage--;
        if (this.noPage < 1) {
            this.noPage = 1;
        }
        this.beforeNoPage = this.noPage;
        this.getAllRehearsalsWithPagination();
    }
    inputPage(event) {
        if (this.noPage < 1 && this.noPage != null) {
            this.noPage = 1;
        }
        else if (this.noPage > this.totalPage) {
            this.noPage = this.totalPage;
        }
        console.log(this.noPage);
        event.target.value = this.noPage;
        if (this.noPage != null) {
            this.beforeNoPage = this.noPage;
            this.getAllRehearsalsWithPagination();
        }
    }
    firstPage() {
        this.noPage = 1;
        this.beforeNoPage = this.noPage;
        this.getAllRehearsalsWithPagination();
    }
    lastPage() {
        this.noPage = this.totalPage;
        this.beforeNoPage = this.noPage;
        this.getAllRehearsalsWithPagination();
    }
    blurInputPage(event) {
        if (this.noPage == null) {
            event.target.value = this.beforeNoPage;
            this.noPage = this.beforeNoPage;
        }
    }
    search() {
        this.noPage = 1;
        this.getAllRehearsalsWithPagination();
        this.getCountAllRehearsal();
    }
}
